import React from "react";
import styled from "styled-components";
import Screen from "../components/mainScreen/Screen";
import Buttons from "../components/mainScreen/Buttons";
import ScreenIndent from "../components/ScreenIndent";
import CoolScreen from "../components/CoolScreen";

const MainScreen = () => {
  return (
    <Wrapper>
      <ScreenIndent style={{ flex: "5" }}>
        <CoolScreen>
          <Screen />
        </CoolScreen>
      </ScreenIndent>
      <Buttons />
    </Wrapper>
  );
};
const Wrapper = styled.div`
  /* border: 4px solid green; */
  flex: 3;
  display: flex;
  flex-direction: column;
  margin: 0px 40px;
`;

export default MainScreen;
